import Card from "../UI/Card";

const ShowUser = (props) => {
  <Card>
    {props.users.map((item) => {
      return (
        <div>
          <h3>{item.name}</h3>
          <p>{item.email}</p>
        </div>
      );
    })}
  </Card>;
};

export default ShowUser;
